script: |
  super -f text -I q10051.spq | sort > q10051.out

inputs:
  - name: q10051.spq
    data: |
      SELECT ALL - col1 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( NOT + - col0 / col0 BETWEEN + col0 / + col2 AND - - col0 * - + col1 * - + 68 + + ( + 1 ) );
  - name: tab2

outputs:
  - name: q10051.out
    data: |
